  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Career and Technical Education,
  2010-11 (EDFacts CTE:2010-11), is one of 17 'topics' identified in the EDFacts documentation
  (in this database, each 'topic' is entered as a separate study); program data is
  available since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts CTE:2010-11 annually
  collects cross-sectional data from states about students who participate in career
  and technical education by subgroups of students at the LEA and SEA levels. EDFacts
  CTE:2010-11 data were collected using the EDFacts Submission System (ESS), a centralized
  portal, and their submission by states is mandatory and required for benefits. Not
  submitting the required reports by a state constitutes a failure to comply with
  law and may have consequences for federal funding to the state. Key statistics produced
  from EDFacts CTE:2010-11 are from 8 data groups with information on CTE Concentrators-Academic
  Achievement, CTE Concentrators-Exiting, CTE Concentrators-Graduates, CTE Concentrators
  in ESEA Graduation Rate, CTE Concentrators-Placement, CTE Concentrators-Technical
  Skills, CTE Concentrators-Programs for Non-Traditional, and CTE Participants-Programs
  for Non-Traditional. For the purposes of this system, data groups are referred to
  as 'variables', as a result of the structure and format of EDFacts' data.\",\n\t\"license_title\":
